import React from "react";
import {useState} from "react";

export default function Todo(){
    const [characters, setCharacters] = useState([
        {name: 'warden'}
    ]);
    return<div>
        <h1>Hello</h1>
        {characters.map((character)=>(
            <div>
                {character.name}
            </div>
        ))}
    </div>
}
